    "fish-springs-national-wildlife-refuge-annual-narrative-report-fiscal-year-1974",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Fish Springs
    National Wildlife Refuge outlines Refuge accomplishments during the 1974 fiscal
    year. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover conditions during the year. Wildlife- including
    migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
    raptors, fish, and reptiles- is also covered. The Refuge development and maintenance
    section discusses physical developments, plantings, vegetation control, and prescribed
    fires. Resource management is outlined; topics include fur harvesting. A progress
    report on field investigations and applied research is also provided. The public
    relations section of the report describes recreational uses, Refuge visitors, Refuge
    participation, hunting, violations, and safety. Items of interest, N-R forms, and
    photographs are attached.",nt"license_title": "License Not Specified",nt"extras":
